import React from 'react';
import { navigationWindowBlind } from "../../styles/Navigation.scss"


const NavigationWindowBlind = props => {
    return (
        <div
            className="navigationWindowBlind"
            onClick={props.onClick}
        ></div>
    )
}

export default NavigationWindowBlind
